async function unlock(pw){

    const plain=await crypto.subtle.decrypt({name:"AES-GCM",iv:new Uint8Array(b64ToBuf(IV_B64))}, aesKey, b64ToBuf(CT_B64));
    const html=new TextDecoder().decode(plain); document.open(); document.write(html); document.close();
  } catch(e) { console.error(e); err.textContent="Decryption failed. Wrong password."; }
}
document.getElementById('f').addEventListener('submit', e=>{e.preventDefault(); const pw=(document.getElementById('pw').value||"").trim();
  if(!pw){document.getElementById('e').textContent="Please enter a password."; return;}
  unlock(pw);
});
</script>
